var PANEL_COLORS = [
    "primary",
    "danger",
    "info",
    "success",
    "warning",
    "grey-lighter",
    "dark",
    "link",
    "grey-light"
];

var createCat = function (idx) {
    var element = document.createElement("div");
    element.className = "column is-half " + 'has-background-' + PANEL_COLORS[Math.abs(idx % PANEL_COLORS.length)];
    element.innerHTML = "<p>PANEL " + idx + "<br/><img src=\"" + cats[idx % 1000] + "\" /></p>";
    return element;
}

var meter = new FPSMeter({
    theme: 'dark',
    heat:  0
});

setTimeout(function() {
    document.body.style.display = "";

    f1 = createFlicking("#flick1", {
        autoResize: true,
        adaptive: true,
        infinite: true,
        duration: 30,
        moveType: {
            type: "snap",
            count: 3
        }
    }).on({
        needPanel: function(e) {
            e.direction === eg.Flicking.DIRECTION.NEXT
                ? e.panel.insertAfter([
                    createCat(e.index + 1),
                    createCat(e.index + 2),
                    createCat(e.index + 3)
                ])
                : e.panel.insertBefore([
                    createCat(e.index - 3),
                    createCat(e.index - 2),
                    createCat(e.index - 1)
                ]);
        }
    });
    var catArr = Array(3000);
    for (var i = 0; i < 3000; i++) {
        catArr[i] = createCat(i);
    }
    f1.append(catArr);
    f1.moveTo(2999, 0);
    // f1.append(createCat(0));
    f1.on("moveEnd", function() { f1.next() });
    f1.next();

    if (window.requestAnimationFrame) {
        var tick = function() {
            meter.tick();
            requestAnimationFrame(tick);
        }

        requestAnimationFrame(tick);
    } else {
        var tick = function() {
            meter.tick();
            setTimeout(tick);
        }
        tick();
    }
}, 500);
